/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import './Menu.module.css'
import './assets/dashboard.css'
import './css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

const Menu = () => {

    const links = [
        { url: '/', title: 'Главная' },
        { url: '/profil', title: 'Свод по профилям' },
        { url: '/disciplina', title: 'Свод по дисциплинам' }
    ]

    return (
        <Navbar>
        <Container>
        <div >
        <header class="navbar navbar-dark sticky-top bg-dark flex-md-nowrap p-0 shadow">
        <a class="navbar-brand col-md-3 col-lg-2 me-0 px-3 ">СамГТУ</a>
        <Navbar.Toggle class="navbar-toggler position-absolute d-md-none collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#sidebarMenu" aria-controls="sidebarMenu" aria-expanded="false" aria-label="Навигация" id="sidebarMenu"/>
          
       
        <div class="dropdown">
            <button class="btn btn-dark dropdown-toggle" type="button" id="dropdownMenuButton2" data-bs-toggle="dropdown" aria-expanded="false">
                2023 год
            </button>
            <ul class="dropdown-menu dropdown-menu-dark" aria-labelledby="dropdownMenuButton2">
                          
                            <li><a class="dropdown-item active" href="index-2.htm?year=2023">2023 год</a></li>
                        </ul>
        </div>
        <span class="form-control-dark w-100"></span>
        <ul class="navbar-nav px-3">
            <li class="nav-item text-nowrap">
                <span class="nav-link">Аналитика</span>
            </li>
        </ul>
    
    </header>

       </div>
       </Container>
    </Navbar>
    );
}

export default Menu;
